INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Dicta dignissimos velit reprehenderit.', 'Aliquam quo voluptates nobis necessitatibus soluta ut qui. Et dolorum amet laboriosam consequatur provident. Quia magnam aliquid et ad suscipit voluptatum.', 'Vel aut consequatur dolor maxime aut. Ut sint ea nisi similique numquam earum et. Et fugiat quidem dolorum dolores qui tempore est.', '1996-10-06');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Fugiat molestiae nihil quo earum.', 'Quod ipsa sint unde molestiae optio aut omnis. Laborum consequatur facilis aut ad.', 'Et consequatur corporis ea animi rerum. Non dolorem architecto quisquam eos quibusdam rerum. Provident culpa amet sit consectetur dolorem assumenda quam quia.', '1996-10-27');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Porro qui nihil harum rerum reprehenderit amet iste.', 'Velit inventore quia ut. Iure temporibus est sed ipsam aliquid est optio eius.', 'Repellendus quia accusantium optio tempore quia rem veniam. Exercitationem earum error dignissimos quasi. Impedit dolor laudantium neque nulla quia sed id.', '1988-09-25');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (4, 4, 'Consequuntur sint beatae dolorum velit qui voluptas est.', 'Dignissimos aut voluptate ut omnis est. Eaque laborum cum rem. Nemo quidem molestiae quas ut. Assumenda minima voluptatem porro consequatur.', 'Pariatur asperiores sunt occaecati hic rerum. Adipisci neque dolorem ut. Ipsum officiis autem optio.\nOmnis tenetur dignissimos enim et. Distinctio sint qui inventore laboriosam consequatur et.', '1998-07-23');
